import React from "react";
import styled from "styled-components";
import { useNavigate } from "react-router-dom";

const Container = styled.div`
  height: 60px;
`;

const Wrapper = styled.div`
  padding: 10px 20px;
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const Left = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
`;

const President = styled.span`
  font-size: 14px;
  cursor: pointer;
`;

const SearchContainer = styled.div`
  border: 0.5px solid lightgray;
  display: flex;
  align-items: center;
  margin-left: 25px;
  padding: 5px;
`;

const Input = styled.input`
  border: none;
`;

const Center = styled.div`
  flex: 1;
  text-align: center;
`;

const Logo = styled.h1`
  font-weight: bold;
`;
const Right = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
  justify-content: flex-end;
`;

const MenuItem = styled.div`
  font-size: 14px;
  cursor: pointer;
  margin-left: 25px;
`;

const Navbar = () => {

  const navigate = useNavigate();

  function onRegister() {
    navigate("/register");
  }

  function onRegister() {
    navigate("/login");
  }

  function onProfile() {
    navigate("/profile");
  }

  return (
    <Container>
      <Wrapper>
        <Left>
          <President>Prezydent</President>
          <SearchContainer>
            <Input placeholder="Wyszukaj" />
          </SearchContainer>
        </Left>
        <Center>
          <Logo>Zarzadzanie Czo≈Çgami</Logo>
        </Center>
        <Right>
          <MenuItem onClick={() => onRegister()}>Zarejestruj</MenuItem>
          <MenuItem onClick={() => onLogin()}>Zaloguj</MenuItem>
          <MenuItem>Profil</MenuItem>
        </Right>
      </Wrapper>
    </Container>
  );
};

export default Navbar;
